export type IconName = keyof typeof Icons;
type IconProps = {
  name: IconName;
  size?: number;
  color?: ColorMap;
  className?: string;
};

export const Icon = ({ name, size, color, className }: IconProps) => {
  const IconToRender = Icons[name];
  return <IconToRender size={size} color={color} className={className} />;
}

interface IconKeysProps {
  [key: string]: string;
}

const IconKeys: Record<IconName, IconName> = Object.entries(Icons).reduce((acc: any, [key]) => {
  acc[key] = key;
  return acc;
}, {});

export {
  Icons,
  IconKeys,
}